import React from "react";
import "./Header.scss";

const ProfileButton = ({ username, thumbnail, logout, menuPop, menu }) => {
  return (
    <div className="ProfileButtonWrapper">
      <div className="ProfileButtonLink" onClick={menuPop}>
        <img
          className="ProfileButtonThumbnail"
          src={thumbnail}
          alt={username}
        />
      </div>
      {menu}
    </div>
  );
};

export default ProfileButton;
